import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div className="container">
        <h1>Simple Calculator</h1>
        <div className="quantity">
          <a className="quantity_minus" tittle="Decrement"><span>-</span></a>
          <input className="quantity" type="number" className="qunatity_input" value="" />
          <a className="quantity_plus" tittle="Increment"><span>+</span></a>
        </div>
      </div>
    )
  }
}

export default App;
